import 'animate.css'
import React from "react";
import loadingPic from './bg.png'
const LandingPage = () => {
  return (
  <main className=' items-center'>
    <img src={loadingPic} className=' self-center m-0 p-0' />
  </main>
  );
};



export default LandingPage;
